import React from "react";

function Footer() {
    return (
        <div id="footer">
            <p>Powered by <span> <a href="https://reactjs.org/" target="_blank" rel="noopener noreferrer">React.js</a></span>&nbsp;&middot;&nbsp;<span>Developed by &nbsp;
            <a href="https://www.linkedin.com/in/tandrima-bhattacharjee-508508144/">Tandrima</a>&nbsp;&&nbsp; 
            <a href="https://www.linkedin.com/in/akash-ghosh-695958111/">Akash</a></span></p>
        </div>
    )
}

export default Footer;
